import React from 'react';

function Projects() {
  return (
    <section>
      <h2>Projects</h2>
      <h3>おみくじアプリ</h3>
      <ul>
        <li><a href=" https://meitomi.github.io/omikuji-app-v2/" target="_blank" rel="noopener noreferrer">デモページを見る</a></li>
        <li><a href="https://github.com/https://github.com/MEITOMI/omikuji-app-v2/omikuji-app-v2" target="_blank" rel="noopener noreferrer">GitHub リポジトリ</a></li>
        <li>使用技術：HTML / CSS / JavaScript</li>
      </ul>
    </section>
  );
}

export default Projects;
